import axios from 'axios';

export default () => {

  const [boards, setBoards] = useState(null)

  useEffect(() => {
    const getAllBoards = async () => {
      const res = await axios.get('http://localhost:3000/boards');

      console.log(res.data);
      setBoards(res.data);
    };
    getAllBoards();
  }, []);
  return <div className=""></div>;
};
